// Given a non-empty array of integers arr and an integer k, return
// the sum of the elements with at most two digits from the first k elements of arr.
//
// Example:
//
// Input: arr = [111,21,3,4000,5,6,7,8,9], k = 4
// Output: 24 # sum of 21 + 3
//
// Constraints:
// 1. 1 <= len(arr) <= 100
// 2. 1 <= k <= len(arr)
func AddElements(arr []int, k int) int {
	sum := 0

	// Iterate through the first k elements of the array.
	// The constraints ensure that k is always valid (1 <= k <= len(arr)).
	for i := 0; i < k; i++ {
		element := arr[i]

		// Check if the element has at most two digits.
		// This means the number must be between -99 and 99 (inclusive).
		// For positive numbers, this means 0-99.
		// For negative numbers, this means -1 to -99.
		if element >= -99 && element <= 99 {
			sum += element
		}
	}

	return sum
}

